import React from 'react';
import { View, Text, StyleSheet } from 'react-native';

const FlightResults = ({ flights }) => {
  return (
    <View style={styles.container}>
      <Text style={styles.title}>Flight Results</Text>
      {flights.map((flight, index) => (
        <View key={index} style={styles.flightItem}>
          <Text>{flight.airline}: {flight.origin} - {flight.destination}</Text>
          <Text>Departure: {flight.departure}</Text>
          <Text>Arrival: {flight.arrival}</Text>
        </View>
      ))}
    </View>
  );
};

const FlightListScreen = ({ route }) => {
  const { departure, destination } = route.params;

  return (
    <View style={styles.container}>
      <Text style={styles.title}>Flight Results</Text>
      <View style={styles.flightItem}>
        <Text>Pemberangkatan: {departure}</Text>
        <Text>Menuju: {destination}</Text>
      </View>
    </View>
  );
}

const styles = StyleSheet.create({
  container: {
    padding: 16,
  },
  title: {
    fontSize: 24,
    marginBottom: 16,
  },
  flightItem: {
    borderWidth: 1,
    borderColor: '#ccc',
    borderRadius: 4,
    paddingHorizontal: 8,
    paddingVertical: 4,
    marginBottom: 8,
  },
});

export default FlightResults;
